import React, { useState } from 'react';
import '../../css/myPage/myPage_product.css';

function MyPageProduct() {
  const [activeTab, setActiveTab] = useState('전체');

  const tabs = ['전체', '대여중', '예약중', '대여완료'];
  const filters = ['최신순', '낮은가격순', '높은가격순'];

  return (
    <div className="product-section">
      <h3 className="section-title">대여상품</h3>

      <div className="product-tabs">
        {tabs.map(tab => (
          <button
            key={tab}
            className={`tab-button ${activeTab === tab ? 'active' : ''}`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </button>
        ))}
      </div>

      <div className="product-filters">
        <span>총 0개</span>
        <div className="filter-options">
          {filters.map((filter, index) => (
            <span key={filter}>
              {filter}
              {index !== filters.length - 1 && <span className="divider">|</span>}
            </span>
          ))}
        </div>
      </div>

      <div className="product-empty">선택된 조건에 해당하는 상품이 없습니다.</div>
    </div>
  );
}

export default MyPageProduct;
